import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import { BASE_URL } from './constants';

const EmployeeDetails = () => {
  const { employeeId } = useParams();  // Retrieve employeeId from route params
  const [employee, setEmployee] = useState({
    _id: "",
    employeeId: "",
    name: "",
    mobileNumber: "",
    alternateMobileNumber: "",
    branch: "",
    designation: "",
    dateOfBirth: "",
    address: "",
    joinDate: "",
    fatherName: "",
    spouseName: "",
    salary: "",
    gender: "",
    createdAt: "",
    updatedAt: "",
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchEmployeeData();
  }, [employeeId]);

  const fetchEmployeeData = async () => {
    try {
      const response = await axios.get(`${BASE_URL}/employees/${employeeId}/details`);
      setEmployee(response.data);
    } catch (err) {
      setError("Failed to fetch employee data.");
    } finally {
      setLoading(false);
    }
  };

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  return (
    <form className="employee-form">
      <label>
        ID
        <input type="text" value={employee._id} readOnly />
      </label>
      <label>
        Employee ID
        <input type="text" value={employee.employeeId} readOnly />
      </label>
      <label>
        Name
        <input type="text" value={employee.name} readOnly />
      </label>
      <label>
        Mobile Number
        <input type="text" value={employee.mobileNumber} readOnly />
      </label>
      <label>
        Alternate Mobile Number
        <input type="text" value={employee.alternateMobileNumber} readOnly />
      </label>
      <label>
        Branch
        <input type="text" value={employee.branch} readOnly />
      </label>
      <label>
        Designation
        <input type="text" value={employee.designation} readOnly />
      </label>
      <label>
        Date of Birth
        <input type="date" value={employee.dateOfBirth ? employee.dateOfBirth.split('T')[0] : ''} readOnly />
      </label>
      <label>
        Address
        <input type="text" value={employee.address} readOnly />
      </label>
      <label>
        Join Date
        <input type="date" value={employee.joinDate ? employee.joinDate.split('T')[0] : ''} readOnly />
      </label>
      <label>
        Father Name
        <input type="text" value={employee.fatherName} readOnly />
      </label>
      <label>
        Spouse Name
        <input type="text" value={employee.spouseName} readOnly />
      </label>
      <label>
        Salary
        <input type="text" value={employee.salary} readOnly />
      </label>
      <label>
        Gender
        <input type="text" value={employee.gender} readOnly />
      </label>
      <label>
        Created At
        <input type="text" value={new Date(employee.createdAt).toLocaleString()} readOnly />
      </label>
      <label>
        Updated At
        <input type="text" value={new Date(employee.updatedAt).toLocaleString()} readOnly />
      </label>
    </form>
  );
};

export default EmployeeDetails;
